COPY public.shows (show_id, title, date_added, description) FROM stdin;
s1	"Dick Johnson Is Dead"	2021-09-25 00:00:00	"As her father nears the end of his life, filmmaker Kirsten Johnson stages his death in inventive and comical ways to help them both face the inevitable."
s2	"Blood & Water"	2021-09-24 00:00:00	"After crossing paths at a party, a Cape Town teen sets out to prove whether a private-school swimming star is her sister who was abducted at birth."
s3	"Ganglands"	2021-09-24 00:00:00	"To protect his family from a powerful drug lord, skilled thief Mehdi and his expert team of robbers are pulled into a violent and deadly turf war."
s4	"Jailbirds New Orleans"	2021-09-24 00:00:00	"Feuds, flirtations and toilet talk go down among the incarcerated women at the Orleans Justice Center in New Orleans on this gritty reality series."
s5	"Kota Factory"	2021-09-24 00:00:00	"In a city of coaching centers known to train India’s finest collegiate minds, an earnest but unexceptional student and his friends navigate campus life."
s6	"Midnight Mass"	2021-09-24 00:00:00	"The arrival of a charismatic young priest brings glorious miracles, ominous mysteries and renewed religious fervor to a dying town desperate to believe."
s7	"My Little Pony: A New Generation"	2021-09-24 00:00:00	"Equestria's divided. But a bright-eyed hero believes Earth Ponies, Pegasi and Unicorns should be pals — and, hoof to heart, she’s determined to prove it."
s8	"Sankofa"	2021-09-24 00:00:00	"On a photo shoot in Ghana, an American model slips back in time, becomes enslaved on a plantation and bears witness to the agony of her ancestral past."
s9	"The Great British Baking Show"	2021-09-24 00:00:00	"A talented batch of amateur bakers face off in a 10-week competition, whipping up their best dishes in the hopes of being named the U.K.'s best."
s10	"The Starling"	2021-09-24 00:00:00	"A woman adjusting to life after a loss contends with a feisty bird that's taken over her garden — and a husband who's struggling to find a way forward."
s11	"Vendetta: Truth, Lies and The Mafia"	2021-09-24 00:00:00	"Sicily boasts a bold ""Anti-Mafia"" coalition. But what happens when those trying to bring down organized crime are accused of being criminals themselves?"
s12	"Bangkok Breaking"	2021-09-23 00:00:00	"Struggling to earn a living in Bangkok, a man joins an emergency rescue service and realizes he must unravel a citywide conspiracy."
s13	"Je Suis Karl"	2021-09-23 00:00:00	"After most of her family is murdered in a terrorist bombing, a young woman is unknowingly lured into joining the very group that killed them."
s14	"Confessions of an Invisible Girl"	2021-09-22 00:00:00	"When the clever but socially-awkward Tetê joins a new school, she'll do anything to fit in. But the queen bee among her classmates has other ideas."
s15	"Crime Stories: India Detectives"	2021-09-22 00:00:00	"Cameras following Bengaluru police on the job offer a rare glimpse into the complex and challenging inner workings of four major crime investigations."
s16	"Dear White People"	2021-09-22 00:00:00	"Students of color navigate the daily slights and slippery politics of life at an Ivy League college that's not nearly as ""post-racial"" as it thinks."
s17	"Europe's Most Dangerous Man: Otto Skorzeny in Spain"	2021-09-22 00:00:00	"Declassified documents reveal the post-WWII life of Otto Skorzeny, a close Hitler ally who escaped to Spain and became an adviser to world presidents."
s18	"Falsa identidad"	2021-09-22 00:00:00	"Strangers Diego and Isabel flee their home in Mexico and pretend to be a married couple to escape his drug-dealing enemies and her abusive husband."
s19	"Intrusion"	2021-09-22 00:00:00	"After a deadly home invasion at a couple’s new dream house, the traumatized wife searches for answers — and learns the real danger is just beginning."
s20	"Jaguar"	2021-09-22 00:00:00	"In the 1960s, a Holocaust survivor joins a group of self-trained spies who seek justice against Nazis fleeing to Spain to hide after WWII."
s21	"Monsters Inside: The 24 Faces of Billy Milligan"	2021-09-22 00:00:00	"In the late 1970s, an accused serial rapist claims multiple personalities control his behavior, setting off a legal odyssey that captivates America."
s22	"Resurrection: Ertugrul"	2021-09-22 00:00:00	"When a good deed unwittingly endangers his clan, a 13th-century Turkish warrior agrees to fight a sultan's enemies in exchange for new tribal land."
s23	"Avvai Shanmughi"	2021-09-21 00:00:00	"Newly divorced and denied visitation rights with his daughter, a doting father disguises himself as a gray-haired nanny in order to spend time with her."
s24	"Go! Go! Cory Carson: Chrissy Takes the Wheel"	2021-09-21 00:00:00	"From arcade games to sled days and hiccup cures, Cory Carson’s curious little sister Chrissy speeds off on her own for fun and adventure all over town!"
s25	"Jeans"	2021-09-21 00:00:00	"When the father of the man she loves insists that his twin sons marry twin sisters, a woman creates an alter ego that might be a bit too convincing."
s26	"Love on the Spectrum"	2021-09-21 00:00:00	"Finding love can be hard for anyone. For young adults on the autism spectrum, exploring the unpredictable world of dating is even more complicated."
